import React, {useCallback, useContext, useReducer} from 'react';
import {QueContext, QueDispatchContext} from "./typeContext/typeContext";
import Single from "./ques/single";
import Checkbox from "./ques/checkbox";
import Location from "./ques/location";
import Rating from "./ques/rating";
import Select from "./ques/select";
import Slider from "./ques/slider";
import Text from "./ques/text";
import RenderQue, {renderQue} from "./renderQue";


function queReducer(que, action) {
	switch (action.type) {
		case 'single':
		case 'checkbox':
		case 'text':
		case 'rating':
		case 'slider':
		case 'select':
		case 'location':
			return action.type;
		default: {
			throw new Error('Unknown que type');
		}
	}
}

const initialQue = 'Single';


const AddQue = () => {
	const [que, dispatch] = useReducer(queReducer, initialQue);

	const handleCheckType = useCallback(e => {
		// console.log(e);
		// console.log(e.target.value)
		dispatch({
			type: e.target.value,
		});
	}, []);

	return (
		<div>
			<select onChange={handleCheckType} name="type" id="">
				<option value="text">填空</option>
				<option value="single">单选</option>
				<option value="checkbox">多选</option>
				<option value="rating">评分</option>
				{/* 拖动滑动条选择数值 */}
				<option value="slider">滑块</option>
				{/* 选项较多时, 如省份选择 */}
				<option value="select">下拉框</option>
				<option value="location">定位</option>
			</select>
			{renderQue(que)}
			{/*<QueContext.Provider value={que}>*/}
			{/*	<QueDispatchContext.Provider value={dispatch}>*/}
			{/*		<He/>*/}
			{/*	</QueDispatchContext.Provider>*/}
			{/*</QueContext.Provider>*/}
		</div>
	);
};

export default AddQue;

